import './App.css';
import Header from './Header'
import Cart from './Cart'
import Home from './Home'
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom"
import styled from 'styled-components'



function App() {
  return (
    <div className="App">
      <Header />

        <Switch>

          <Route path="/cart">
            <Cart />
          </Route>

          <Route path="/">
            <Home />
          </Route>

        </Switch>
    </div>
  );
}

export default App;
